import React from "react";

function App() {
  return (
    <div>
      <div style={{ border: "solid  1px black" }}>
        <h1 class="title red">Votre nom ici</h1>

        <img src="/photo.png" alt="image1" width="100" height="50"></img>
        <p>achref belhay</p>
      </div>
    </div>
  );
}
export default App;
